import React  , {useState} from "react";
import { BrowserRouter, Switch, Route } from "react-router-dom";
import Home from "./core/Home";
import Signup from "./user/Signup";
import Signin from "./user/Signin";
import AdminRoute from "./auth/helper/AdminRoutes";
import PrivateRoute from "./auth/helper/PrivateRoutes";
import UserDashBoard from "./user/UserDashBoard";
import AdminDashBoard from "./user/AdminDashBoard";
import AddSkill from "./admin/AddSkill";
import AddProject from "./admin/AddProject";
import AddEducation from "./admin/AddEducation";
import ManageProjects from "./admin/ManageProjects";
import ManageSkill from "./admin/ManageSkill";
import Cart from "./core/Cart";
import Menu from "./core/Menu";


const Routes = () => {
  const [navToggle, setNavToggle] = useState(false);

  const navClick = () =>{
    setNavToggle(!navToggle)
  }

  return (
    <div className="App">
      <div className={`sidebar ${navToggle ? 'nav-toggle': ''}`}>
        <Menu />
      </div>
      <div className="nav-btn" onClick={navClick}>
        <div className="lines-1"></div>
        <div className="lines-2"></div>
        <div className="lines-3"></div>
      </div>
      <div className="main-content">
          <div className="content">
            <Switch>
              <Route path="/" exact>
                <Home />
              </Route>
              <Route path="/cart" exact>
                <Cart />
              </Route>
              <Route path="/signup" exact>
                <Signup />
              </Route>
              <Route path="/signin" exact>
                <Signin />
              </Route>
              <PrivateRoute path="/user/dashboard" exact>
                <UserDashBoard />
              </PrivateRoute>
              <AdminRoute path="/admin/dashboard" exact>
                <AdminDashBoard />
              </AdminRoute>
              <AdminRoute
          path="/admin/create/skill"
          exact >
        <AddSkill />
        </AdminRoute>
        <AdminRoute
          path="/admin/create/education" exact
          ><AddEducation /></AdminRoute>

        <AdminRoute
          path="/admin/create/project" exact
         > <AddProject />
         </AdminRoute>

         <AdminRoute
          path="/admin/projects"
         ><ManageProjects /> </AdminRoute>

         <AdminRoute
          path="/admin/skills"
          > <ManageSkill /> </AdminRoute>
            </Switch>
          </div>
      </div>
    </div>
  );
}

export default Routes;
